               <label className ={Styles.input} for = "confirmPassword" >CONFIRM PASSWORD</label><input  ref = "confirmPassword"></input>

            </form>
            <button className = {Styles.button} onClick = {this.register}> Register</button>

         </div>
     )
    }
}
